全品！送料無料キャンペーン実施中！<br>(※一部地域除く詳しくはご利用ガイドをご覧ください)撥水加工ガラス対応ワイパーブレード替えゴム（レール付）<br><br>■摩擦抵抗を大幅低減<br>■ビビリをなくし、スムーズな拭き取りを実現しました<br><br>?グラファイトコート ワイパーラバーの特徴このワイパーブレード替えゴムはグラファイトコーティングを施した高品質ラバーを採用しています。<br>グラファイトコーティングの効果は摩擦抵抗が大きく減少。<br>ビビリをなくし、スムーズな拭き取りを実現しました。<br>ガラス表面のコーティング被膜上でも、被膜にダメージを与えることなくソフトに動作でき、撥水効果を長く持続させることができます。<br><br>長さ：500mm<br>幅：6mm<br>参考品番：GS-50<br>入り数：1箱（1箱10本入）<br>整備・鈑金・カーケア業者販売向けの数量になります。<br>【送料込み】の特別価格の適用になります。<br><br>※ご使用になる車種のサイズをご確認の上お間違い内容ご確認寝願います。<img src="http://image.rakuten.co.jp/suncardo/cabinet/sign-banner/700x150-20.jpg" border="0">
